webpackJsonp([0x7d914dcb8c21],{503:function(e,t){e.exports={data:{markdownRemark:{html:"<h3>Edit Vulnerability Type</h3>\n<p>Programs can now edit the vulnerability type of a report after the report has been submitted. This is to correctly associate a report with the right vulnerability type if a hacker selected the wrong one.</p>\n<h3>Policy Versioning</h3>\n<p>Hackers can now see when the policy was last changed and view all policy changes on a program’s Security Page. </p>\n<h3>No More Negative Reputation for “Needs More Info”</h3>\n<p>We’ve adjusted our reputation system so that reports marked as “Needs More Information” doesn’t result in a -1 reputation hit. </p>\n<h3>Hacktivity on Hacker Profiles</h3>\n<p>We now display all reports hackers have on hacktivity onto their profile page. </p>",frontmatter:{path:"/changelog/2016/july",title:"July 2016"}}},pathContext:{}}}});
